     Photoshop Secrets:
     FOR DIGITAL PHOTOGRAPHERS
     (Photoshop CS Training Video) 

     Approx. 3 Hours :: 33 Lessons 

     Learn the secrets of the pros from an award-winning expert who has 
     excelled in the field and understands your needs and deadlines. In a warm
     conversational style, Colin clearly explains what you need to know without
     using empty jargon. You can use these Photoshop techniques with confidence,
     knowing that these are industry strength methods that produce professional
     results. 

     This fast loading CD ROM contains almost 3 hours of sharp 800 x 600 video 
     with crisp, clear sound. The advanced interface allows the user to 
     instantly jump to any of the 33 lessons with complete control over the 
     playback. All the image files are included, so you can follow along!

     If you are a photographer, designer, hobbyist, anyone who works with 
     images, novice to professional, this Photoshop Training Video CD is for
     you!

     http://www.dreamweavercafe.com/photoshopCD/photoshop-dp.htm

     Have Fun!

     And as always...if u like it, buy it....


